import React from "react";

const Contact = () => {
  return (
    <>
      <div className="my-5">
        <h1 className="text-center">Contact US</h1>
      </div>
      <div className="conainer contact_div">
        <div className="row">
          <div className="col-md-6 col-10 mx-auto">
            <form></form>
          </div>
        </div>
      </div>
    </>
  );
};

export default Contact;
